import axios from 'axios';

const fetchGet = async (url, params = {} ) => {
    return await axios({
        url,
        method : 'GET',
        params : params,
    })
}

const fetchPut = async (url, data = {} ) => {
    return await axios({
        url,
        method : 'PUT',
        data : data,
    })
}

const fetchPost = async (url, data = {} ) => {
    return await axios({
        url,
        method : 'POST',
        data : data,
    })
}

const fetchDelete = async (url, params = {} ) => {
    return await axios({
        url,
        method : 'DELETE',
        params : params,
    })
}

const funcs = {
    fetchGet,
    fetchPut,
    fetchPost,
    fetchDelete,
}

export default funcs;
